(1513, '_transient_dash_88ae138922fe95674369b1cb3d215a2b', '<div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://wordpress.org/news/2015/09/wordpress-4-3-1/''>WordPress 4.3.1 Security and Maintenance Release</a> <span class="rss-date">September 15, 2015</span><div class="rssSummary">WordPress 4.3.1 is now available. This is a security release for all previous versions and we strongly encourage you to update your sites immediately. This release addresses three issues, including two cross-site scripting vulnerabilities and a potential privilege escalation. WordPress versions 4.3 and earlier are vulnerable to a cross-site scripting vulnerability when processing shortcode tags (CVE-2015-5714). Reported by [&hellip;]</div></li></ul></div><div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://poststatus.com/local-wordpress-development-strategies-and-transparency-in-business-draft-podcast/''>Post Status: Local WordPress development strategies and transparency in business — Draft podcast</a></li><li><a class=''rsswidget'' href=''http://ma.tt/2015/09/winning-remote-work-culture/''>Matt: Winning Remote Work Culture</a></li><li><a class=''rsswidget'' href=''https://poststatus.com/gravity-flow-makes-custom-form-administrative-workflows-simple/''>Post Status: Gravity Flow makes custom form administrative workflows simple</a></li></ul></div><div class="rss-widget"><ul><li class=''dashboard-news-plugin''><span>Popular Plugin:</span> <a href=''https://wordpress.org/plugins/black-studio-tinymce-widget/'' class=''dashboard-news-plugin-link''>Black Studio TinyMCE Widget</a>&nbsp;<span>(<a href=''plugin-install.php?tab=plugin-information&amp;plugin=black-studio-tinymce-widget&amp;_wpnonce=bb7e7bdb1d&amp;TB_iframe=true&amp;width=600&amp;height=800'' class=''thickbox'' title=''Black Studio TinyMCE Widget''>Install</a>)</span></li></ul></div>', 'no'),
