(58, 1, '2015-09-02 01:02:42', '2015-09-02 01:02:42', '&nbsp;\r\n\r\n[caption id="attachment_31" align="alignnone" width="300"]<a href="http://localhost/wordpress/wp-content/uploads/2015/09/Childrens-Medicine-1361703634_161.jpg"><img class="size-medium wp-image-31" src="http://localhost/wordpress/wp-content/uploads/2015/09/Childrens-Medicine-1361703634_161-300x200.jpg" alt="Children''s Medicine" width="300" height="200" /></a> Children''s Medicine[/caption]\r\n\r\n&nbsp;\r\n\r\nThe best way to convey the truth about drugs is through the words of <strong>those who have “been there.”</strong> By telling their stories, they can pass on what they have learned so others avoid going down the same path.\r\n\r\nShare this information with your friends. Drug education saves lives.\r\n\r\n<em>“My goal in life wasn''t living...it was getting high. I was falling in a downward spiral towards a point of no return. Over the years, I turned to <a href="http://www.drugfreeworld.org/drugfacts/cocaine.html">cocaine</a>, <a href="http://www.drugfreeworld.org/drugfacts/marijuana.html">marijuana</a> and <a href="http://www.drugfreeworld.org/drugfacts/alcohol.html">alcohol </a>under a false belief it would allow me to escape my problems. It just made things worse. I had everything, a good job, money, a loving family, yet I felt so empty inside. As if I had nothing. Over twenty years of using, I kept saying to myself, I’m going to stop permanently after using this last time. It never happened. There were even moments I had thought of giving up on life.” </em>—<strong>John</strong>\r\n\r\n<em>“It started with the <a href="http://www.drugfreeworld.org/drugfacts/marijuana.html">weed</a>, then the <a href="http://www.drugfreeworld.org/drugfacts/ecstasy.html">pills (Ecstasy)</a> and <a href="http://www.drugfreeworld.org/drugfacts/lsd.html">acid</a>, making cocktails of all sorts of drugs, even overdosing to make the rushes last longer. I took copious amounts of these chemicals every day for as long as two years until I had a bad trip one night and went into toxic psychosis. I prayed and cried for this feeling to go away, I had voices in my head, had the shakes and couldn''t leave home for six months. I became very withdrawn and thought everyone was watching me. I couldn’t walk in public places. Man! I couldn’t even drive.</em>\r\n\r\n<em>“I ended up homeless and on the streets, living and sleeping in a cardboard box, begging and struggling to find ways to get my next meal.</em>\r\n\r\n<em>“I asked myself if this is rock bottom, and I believe that it was. While observing these homeless people I decided that I had had enough. Yes I wanted drugs, but I realized that I could want life more.” </em>—<strong>Ben</strong>', 'REAL LIFE STORIES: ABOUT DRUG ABUSE', '', 'inherit', 'closed', 'closed', '', '12-revision-v1', '', '', '2015-09-02 01:02:42', '2015-09-02 01:02:42', '', 12, 'http://localhost/wordpress/index.php/2015/09/02/12-revision-v1/', 0, 'revision', '', 0),
