(70, 1, '2015-09-02 08:23:06', '2015-09-02 08:23:06', 'Falcon IT Solutions, our team believes in delivering simple &amp; reliable web solutions. We are fully aware of our potential and wanted to provide solutions to users that are not only purposeful but also can bring change in their life or community. So, What can we do? Drug Issues have been in headlines and has been creating pressing issues for the government and the people in Victoria. With the increasing concern of our loved one’s safety and wanting them not to get addicted to any drug habits. We decided to build an informational and interactive website that can help Victorian Residents or the prospective residents to know about the drug related issues in their suburb and surrounding areas. Our Website would help the users to analyze the suburb profile and also provide them details about the rehabilitation centers in their proximity. We also guide our registered users through their application process for rehabilitation services.', 'About Us', '', 'inherit', 'closed', 'closed', '', '10-revision-v1', '', '', '2015-09-02 08:23:06', '2015-09-02 08:23:06', '', 10, 'http://localhost/wordpress/index.php/2015/09/02/10-revision-v1/', 0, 'revision', '', 0),
