(112, 1, '2015-09-05 07:47:32', '2015-09-05 07:47:32', '<blockquote>Student life can seem to revolve around alcohol, with the student bar and local pubs often the centre of the college social scene\r\nDrinking in moderation is an enjoyable and usually\r\nharmless feature of student life. Getting drunk regularly can have potentially serious physical, social and academic effects. Even drinking to excess just occasionally can be damaging.\r\nIn the short term, drinking too much can impair academic performance because it affects concentration and makes you more likely to miss classes, hand in work late and do badly in exams. It can also put you at immediate risk of serious harm, ranging from date rape to car crashes. If you’re drunk, you’re also more likely to be a victim of violence or to have unprotected sex, which carries all the associated risks of sexually transmitted infections (STIs) and unplanned pregnancy.\r\nIn the longer term, regularly drinking too much can cause liver disease, an increased risk of heart attack, weight gain and a number of different cancers. These problems are now occurring at younger ages as alcohol use has increased. The healthy choice in the short term is to take just a little extra care to protect yourself and your friends when you are going out drinking. For example, know your own limits and make sure you know how to get home safely.</blockquote>\r\n&nbsp;', 'Students: smoking, alcohol and drugs', '', 'publish', 'open', 'open', '', 'students-smoking-alcohol-and-drugs', '', '', '2015-09-21 08:30:10', '2015-09-21 08:30:10', '', 0, 'http://localhost/wordpress/?p=112', 0, 'post', '', 0),
(113, 1, '2015-09-05 07:47:32', '2015-09-05 07:47:32', '\r\n\r\nStudent life can seem to revolve around alcohol, with the student bar and local pubs often the centre of the college social scene.\r\nDrinking in moderation is an enjoyable and usually harmless feature of student life. Getting drunk regularly can have potentially serious physical, social and academic effects. Even drinking to excess just occasionally can be damaging.\r\nIn the short term, drinking too much can impair academic performance because it affects concentration and makes you more likely to miss classes, hand in work late and do badly in exams.\r\nIt can also put you at immediate risk of serious harm, ranging from date rape to car crashes. If you’re drunk, you’re also more likely to be a victim of violence or to have unprotected sex, which carries all the associated risks of sexually transmitted infections (STIs) and unplanned pregnancy.\r\nIn the longer term, regularly drinking too much can cause liver disease, an increased risk of heart attack, weight gain and a number of different cancers. These problems are now occurring at younger ages as alcohol use has increased.\r\nThe healthy choice in the short term is to take just a little extra care to protect yourself and your friends when you are going out drinking. For example, know your own limits and make sure you know how to get home safely.\r\n\r\nFor full Article Visit:\r\n<a href="http://www.nhs.uk/Livewell/studenthealth/Pages/Smoking,alcoholanddrugs.aspx"></a>\r\n', 'Students: smoking, alcohol and drugs', '', 'inherit', 'closed', 'closed', '', '112-revision-v1', '', '', '2015-09-05 07:47:32', '2015-09-05 07:47:32', '', 112, 'http://localhost/wordpress/index.php/2015/09/05/112-revision-v1/', 0, 'revision', '', 0),
