(133, 1, '2015-09-09 12:20:46', '2015-09-09 12:20:46', 'Falcon IT Solutions, our team believes in delivering simple &amp; reliable web solutions. We are fully aware of our potential and wanted to provide solutions to users that are not only purposeful but also can bring change in their life or community. So, What can we do? Drug Issues have been in headlines and has been creating pressing issues for the government and the people in Victoria. With the increasing concern of our loved one’s safety and wanting them not to get addicted to any drug habits. We decided to build an informational and interactive website that can help Victorian Residents or the prospective residents to know about the drug related issues in their suburb and surrounding areas. Our Website would help the users to analyse the suburb profile and also provide them details about the rehabilitation centres in their proximity. We also guide our registered users through their application process for rehabilitation services.\n\n<strong>Meet our Team</strong>\n\n[caption id="attachment_142" align="alignnone" width="209"]<a href="http://localhost/wordpress/wp-content/uploads/2015/09/Picture1.png"><img class="wp-image-142 size-full" src="http://localhost/wordpress/wp-content/uploads/2015/09/Picture1.png" alt="" width="209" height="157" /></a> Nitin Krishnan[/caption]\n\n[caption id="attachment_148" align="alignleft" width="150"]<img class="wp-image-148 size-thumbnail" src="http://localhost/wordpress/wp-content/uploads/2015/09/Picture4-150x150.png" alt="" width="150" height="150" /> Shunan (User Interface Designer)[/caption]\n\n[caption id="attachment_148" align="alignleft" width="150"]<img class="wp-image-148 size-thumbnail" src="http://localhost/wordpress/wp-content/uploads/2015/09/Picture4-150x150.png" alt="" width="150" height="150" /> Shunan (User Interface Designer)[/caption]\n\n[caption id="attachment_148" align="alignleft" width="150"]<img class="wp-image-148 size-thumbnail" src="http://localhost/wordpress/wp-content/uploads/2015/09/Picture4-150x150.png" alt="" width="150" height="150" /> Shunan (User Interface Designer)[/caption]', 'About Us', '', 'inherit', 'closed', 'closed', '', '10-autosave-v1', '', '', '2015-09-09 12:20:46', '2015-09-09 12:20:46', '', 10, 'http://localhost/wordpress/index.php/2015/09/09/10-autosave-v1/', 0, 'revision', '', 0),
