(136, 1, '2015-09-09 01:44:09', '2015-09-09 01:44:09', 'Student life can seem to revolve around alcohol, with the student bar and local pubs often the centre of the college social scene. Drinking in moderation is an enjoyable and usually harmless feature of student life. Getting drunk regularly can have potentially serious physical, social and academic effects. Even drinking to excess just occasionally can be damaging.\r\nIn the short term, drinking too much can impair academic performance because it affects concentration and makes you more likely to miss classes, hand in work late and do badly in exams. It can also put you at immediate risk of serious harm, ranging from date rape to car crashes. If you’re drunk, you’re also more likely to be a victim of violence or to have unprotected sex, which carries all the associated risks of sexually transmitted infections (STIs) and unplanned pregnancy.\r\nIn the longer term, regularly drinking too much can cause liver disease, an increased risk of heart attack, weight gain and a number of different cancers. These problems are now occurring at younger ages as alcohol use has increased. The healthy choice in the short term is to take just a little extra care to protect yourself and your friends when you are going out drinking. For example, know your own limits and make sure you know how to get home safely.\r\n\r\n&nbsp;', 'Students: smoking, alcohol and drugs', '', 'inherit', 'closed', 'closed', '', '112-revision-v1', '', '', '2015-09-09 01:44:09', '2015-09-09 01:44:09', '', 112, 'http://localhost/wordpress/index.php/2015/09/09/112-revision-v1/', 0, 'revision', '', 0),
(137, 1, '2015-09-21 08:33:53', '2015-09-21 08:33:53', '<blockquote>&nbsp;\n<p class="mceTemp"></p>\n\n<dl id="attachment_31" class="wp-caption alignnone" style="width: 170px;"><dt class="wp-caption-dt"><strong><a href="http://localhost/wordpress/wp-content/uploads/2015/09/Childrens-Medicine-1361703634_161.jpg"><img class=" wp-image-31" src="http://localhost/wordpress/wp-content/uploads/2015/09/Childrens-Medicine-1361703634_161-300x200.jpg" alt="Children''s Medicine" width="170" height="113" /></a></strong></dt><dd class="wp-caption-dd"><strong><em>Children''s Medicine</em></strong></dd></dl>\n<p style="text-align: justify; text-justify: inter-ideograph;"><strong><em><span style="font-size: 12.0pt; font-family: Georgia;">The best way to convey the</span><span style="font-size: 12.0pt; font-family: Georgia;"> trut</span><span style="font-size: 12.0pt; font-family: Georgia;">h</span><span style="font-size: 12.0pt; font-family: Georgia;"> about drugs is through the words of <span style="font-family: Georgia;">those who have “been there.”</span>\n</span></em></strong></p>\n<strong><em>By telling their stories, they can pass on what they have learned so others avoid going down the same path.</em></strong>\n<p style="text-align: justify; text-justify: inter-ideograph;"><strong><em><span style="font-size: 12.0pt; font-family: Georgia;">Share this information with your friends. Drug education saves lives.</span></em></strong></p>\n<p style="text-align: justify; text-justify: inter-ideograph;"><strong><em><span style="font-size: 12.0pt; font-family: Georgia;">“My goal in life wasn''t living...it was getting high. I was falling in a downward spiral towards a point of no return. Over the years, I turned to <a href="http://www.drugfreeworld.org/drugfacts/cocaine.html">cocaine</a>, <a href="http://www.drugfreeworld.org/drugfacts/marijuana.html">marijuana</a> and <a href="http://www.drugfreeworld.org/drugfacts/alcohol.html">alcohol </a>under a false belief it would allow me to escape my problems. It just made things worse. I had everything, a good job, money, a loving family, yet I felt so empty inside. As if I had nothing. Over twenty years of using, I kept saying to myself, I’m going to stop permanently after using this last time. It never happened. There were even moments I had thought of giving up on life.” </span><span style="font-size: 12.0pt; font-family: Georgia;">—<span style="font-family: Georgia;">John</span></span></em></strong></p>\n<p style="text-align: justify; text-justify: inter-ideograph;"><strong><em><span style="font-size: 12.0pt; font-family: Georgia;">“It started with the <a href="http://www.drugfreeworld.org/drugfacts/marijuana.html">weed</a>, then the <a href="http://www.drugfreeworld.org/drugfacts/ecstasy.html">pills (Ecstasy)</a> and <a href="http://www.drugfreeworld.org/drugfacts/lsd.html">acid</a>, making cocktails of all sorts of drugs, even overdosing to make the rushes last longer. </span></em></strong></p>\n<strong><em>I took copious amounts of these chemicals every day for as long as two years until I had a bad trip one night and went into toxic psychosis. I prayed and cried for this feeling to go away, I had voices in my head, had the shakes and couldn''t leave home for six months. I became very withdrawn and thought everyone was watching me. I couldn’t walk in public places. Man! I couldn’t even drive.”</em></strong>\n<p style="text-align: justify; text-justify: inter-ideograph;"><strong><em><span style="font-size: 12.0pt; font-family: Georgia;">“I ended up homeless and on the streets, living and sleeping in a cardboard box, begging and struggling to find ways to get my next meal.”</span></em></strong></p>\n<p style="text-align: justify; text-justify: inter-ideograph;"><strong><em><span style="font-size: 12.0pt; font-family: Georgia;">“I asked myself if this is rock bottom, and I believe that it was. While observing these homeless people I decided that I had had enough. Yes I wanted drugs, but I realized that I could want life more.” </span><span style="font-size: 12.0pt; font-family: Georgia;">—<span style="font-family: Georgia;">Ben</span></span></em></strong></p>\n&nbsp;</blockquote>', 'REAL LIFE STORIES: ABOUT DRUG ABUSE', '', 'inherit', 'closed', 'closed', '', '12-autosave-v1', '', '', '2015-09-21 08:33:53', '2015-09-21 08:33:53', '', 12, 'http://localhost/wordpress/index.php/2015/09/09/12-autosave-v1/', 0, 'revision', '', 0),
(138, 1, '2015-09-09 01:48:25', '2015-09-09 01:48:25', '&nbsp;\r\n\r\n[caption id="attachment_31" align="alignnone" width="300"]<a href="http://localhost/wordpress/wp-content/uploads/2015/09/Childrens-Medicine-1361703634_161.jpg"><img class="size-medium wp-image-31" src="http://localhost/wordpress/wp-content/uploads/2015/09/Childrens-Medicine-1361703634_161-300x200.jpg" alt="Children''s Medicine" width="300" height="200" /></a> Children''s Medicine[/caption]\r\n<p style="text-align: justify; text-justify: inter-ideograph;"><span style="font-size: 12.0pt; font-family: Georgia;">The best way to convey the truth about drugs is through the words of <strong><span style="font-family: Georgia;">those who have “been there.”</span></strong> By telling their stories, they can pass on what they have learned so others avoid going down the same path.</span></p>\r\n<p style="text-align: justify; text-justify: inter-ideograph;"><span style="font-size: 12.0pt; font-family: Georgia;">Share this information with your friends. Drug education saves lives.</span></p>\r\n<p style="text-align: justify; text-justify: inter-ideograph;"><em><span style="font-size: 12.0pt; font-family: Georgia;">“My goal in life wasn''t living...it was getting high. I was falling in a downward spiral towards a point of no return. Over the years, I turned to <a href="http://www.drugfreeworld.org/drugfacts/cocaine.html">cocaine</a>, <a href="http://www.drugfreeworld.org/drugfacts/marijuana.html">marijuana</a> and <a href="http://www.drugfreeworld.org/drugfacts/alcohol.html">alcohol </a>under a false belief it would allow me to escape my problems. It just made things worse. I had everything, a good job, money, a loving family, yet I felt so empty inside. As if I had nothing. Over twenty years of using, I kept saying to myself, I’m going to stop permanently after using this last time. It never happened. There were even moments I had thought of giving up on life.” </span></em><span style="font-size: 12.0pt; font-family: Georgia;">—<strong><span style="font-family: Georgia;">John</span></strong></span></p>\r\n<p style="text-align: justify; text-justify: inter-ideograph;"><em><span style="font-size: 12.0pt; font-family: Georgia;">“It started with the <a href="http://www.drugfreeworld.org/drugfacts/marijuana.html">weed</a>, then the <a href="http://www.drugfreeworld.org/drugfacts/ecstasy.html">pills (Ecstasy)</a> and <a href="http://www.drugfreeworld.org/drugfacts/lsd.html">acid</a>, making cocktails of all sorts of drugs, even overdosing to make the rushes last longer. I took copious amounts of these chemicals every day for as long as two years until I had a bad trip one night and went into toxic psychosis. I prayed and cried for this feeling to go away, I had voices in my head, had the shakes and couldn''t leave home for six months. I became very withdrawn and thought everyone was watching me. I couldn’t walk in public places. Man! I couldn’t even drive.”</span></em></p>\r\n<p style="text-align: justify; text-justify: inter-ideograph;"><em><span style="font-size: 12.0pt; font-family: Georgia;">“I ended up homeless and on the streets, living and sleeping in a cardboard box, begging and struggling to find ways to get my next meal.”</span></em></p>\r\n<p style="text-align: justify; text-justify: inter-ideograph;"><em><span style="font-size: 12.0pt; font-family: Georgia;">“I asked myself if this is rock bottom, and I believe that it was. While observing these homeless people I decided that I had had enough. Yes I wanted drugs, but I realized that I could want life more.” </span></em><span style="font-size: 12.0pt; font-family: Georgia;">—<strong><span style="font-family: Georgia;">Ben</span></strong></span></p>\r\n&nbsp;', 'REAL LIFE STORIES: ABOUT DRUG ABUSE', '', 'inherit', 'closed', 'closed', '', '12-revision-v1', '', '', '2015-09-09 01:48:25', '2015-09-09 01:48:25', '', 12, 'http://localhost/wordpress/index.php/2015/09/09/12-revision-v1/', 0, 'revision', '', 0),
