(153, 1, '2015-09-09 11:51:02', '2015-09-09 11:51:02', 'Falcon IT Solutions, our team believes in delivering simple &amp; reliable web solutions. We are fully aware of our potential and wanted to provide solutions to users that are not only purposeful but also can bring change in their life or community. So, What can we do? Drug Issues have been in headlines and has been creating pressing issues for the government and the people in Victoria. With the increasing concern of our loved one’s safety and wanting them not to get addicted to any drug habits. We decided to build an informational and interactive website that can help Victorian Residents or the prospective residents to know about the drug related issues in their suburb and surrounding areas. Our Website would help the users to analyse the suburb profile and also provide them details about the rehabilitation centres in their proximity. We also guide our registered users through their application process for rehabilitation services.\r\n\r\nMeet our Team\r\n\r\nProject Manger\r\n\r\n&nbsp;\r\n<div id="team" class="profile-background">\r\n<div class="container"><section class="row profiles">\r\n<div class="intro">\r\n<h2>Meet The Team</h2>\r\n</div>\r\n<article class="col-sm-6 profile">\r\n<div class="profile-header"><img class="alignnone size-full wp-image-142" src="http://localhost/wordpress/wp-content/uploads/2015/09/Picture1.png" alt="Picture1" width="209" height="157" /></div>\r\n<div class="profile-content">\r\n<h3>Pugal</h3>\r\n<p class="lead position">Liaison</p>\r\nPugal is a MBIS student at Monash University\r\n\r\n</div>\r\n<div class="profile-footer"><!--						<a href="tel:--><!--"><i class="fa fa-phone-square"></i></a>-->\r\n<i class="fa fa-envelope"></i>\r\n<i class="fa fa-linkedin-square"></i></div>\r\n</article><!-- /.profile -->\r\n\r\n<article class="col-sm-6 profile">\r\n<div class="profile-header"><img class="img-circle" src="http://energysmartresident.tk/wp-content/uploads/2015/08/Mingda.png" 