(224, 1, '2015-09-21 06:33:18', '2015-09-21 06:33:18', '<p style="text-align: justify;">The Website http://www.drugfreecommunity.ml/is an informational website which\r\nis a community resource that not only provides the information about the rehabilitation centers, but also provides statistical data of the suburb profile that help would help our customers in analysing which suburb is at high or low risk of drug related issues.</p>', '5 . What is the Drug Free Community Website?', '', 'publish', 'closed', 'closed', '', 'what-is-the-drug-free-community-website', '', '', '2015-09-21 06:38:34', '2015-09-21 06:38:34', '', 0, 'http://localhost/wordpress/?post_type=sp_faq&#038;p=224', 0, 'sp_faq', '', 0),
